import React from 'react';

const CustomerDetail = (props) => {
    const customer = props.customer.map((details)=>{
        return <li  className="customer-detail">
            {details}
        </li>
    })

    return(
        <ul className="customer-item-details">
            {customer}
        </ul>
    )
}

export default CustomerDetail;
